import { useState } from "react";
import Log from "../images/file.png"
import PopUpLogs from "../components/PopUpLogs";

export default function Navbar() {
    const [popUpTurnOnOff , setPopUpTurnOnOff] = useState(false);
    function handleClick(e) {
        e.preventDefault();
        setPopUpTurnOnOff(!popUpTurnOnOff);
    }
    return (
        <div className="bg-navbar text-white w-full text-center">
            <div className="max-w-screen-sm mx-auto flex justify-between items-center p-4">
                <h1 className="text-2xl">เช็คเวลาเปิดปิดน้ำ</h1>
                <button onClick={handleClick} className="rounded p-2 bg-red-600">
                    <img className="w-6" src={Log} alt="log"/>
                </button>
            </div>
            <PopUpLogs Turn={popUpTurnOnOff}/>
        </div>
        );
}
